import React from 'react';
import data from './categorypost.json';
import { NavLink } from 'react-router-dom';
import Post from './Post';

function App(props) {
  const post = data.data;
  return (
    <div>
      {post.map((post) => {
        return (
          <NavLink to={`${post.id}`}>
            <h1>{post.category}</h1>
          </NavLink>
        );
      })}
      <Post />
    </div>
  );
}

export default App;
